class Contact extends Component {
  render() {
    return (
      <main>
      <div className='background'>
        {/* <img className='homeImg' src={} alt="img"></img> */}
          <main className='title-container'>
            <h1 className='title-concat'>THANK</h1>
            <h1 className='title-concat'>YOU</h1>
          </main>
          <h3 className='title2'>Gostou do meu Trabalho?</h3>
          <h4 className='title3'>Entre em contato.</h4>
      </div>
    </main>
    )
  }
}

export default Contact
